Here's a basic example of a Discord bot using Discord.js v14 that has a single slash command called `/ban`:

```javascript
const { Client, GatewayIntentBits } = require('discord.js');
const { token } = require('./config.json');

const client = new Client({
  intents: [GatewayIntentBits.Guilds, GatewayIntentBits.GuildMembers, GatewayIntentBits.GuildBans],
});

client.commands = new Map();

client.commands.set('ban', {
  name: 'ban',
  description: 'Bans a member from the server.',
  options: [
    {
      name: 'member',
      description: 'The member to ban.',
      type: 'member',
      required: true,
    },
  ],
  execute: async (interaction) => {
    const member = interaction.options.getMember('member');
    if (!member.bannable) {
      return interaction.reply({ content: `You cannot ban ${member}`, ephemeral: true });
    }
    await member.ban();
    interaction.reply({ content: `Banned ${member} successfully.` });
  },
});

client.on('ready', () => {
  console.log('The bot is online!');
});

client.on('interactionCreate', async (interaction) => {
  if (!interaction.isChatInputCommand()) return;

  const { command } = interaction;
  if (!client.commands.has(command.name)) return;

  try {
    await client.commands.get(command.name).execute(interaction);
  } catch (error) {
    console.error(error);
    interaction.reply({ content: 'There was an error while executing this command!', ephemeral: true });
  }
});

client.login(token);
```

This code sets up a bot with a single slash command called `/ban`. The `/ban` command takes a `member` option, which is the member to ban. If the member is not bannable (for example, if they are the bot itself), the bot sends an ephemeral response saying that they cannot be banned. Otherwise, the bot bans the member and sends a message saying that the member was banned successfully.

Remember to replace `token` with your bot's token and put this code in a file named `main.js`, then run `node main.js` in your terminal to start the bot.

Here is an example of a high-quality testing framework in Cypress that utilizes Docker and captures screenshots:
```javascript
// cypress/support/index.js
import { addCommand } from 'cypress';
import * as docker from 'cypress-docker';
import * as screenshot from 'cypress-screenshot';

// Set up Docker
const dockerConfig = {
  image: 'node:14',
  command: 'npm run test',
  volumes: [
    './cypress', // Map the current directory to /app in the container
    {'type': 'volume', 'source': '/app/node_modules', 'target': '/app/node_modules'},
  ],
  ports: ['3000:3000'], // Map port 3000 in the container to port 3000 on the host
};

// Set up screenshot plugin
addCommand('screenshot', () => {
  screenshot.save('cypress/screenshots');
});

// Define a test that uses the screenshot command
describe('My App', () => {
  beforeEach(() => {
    cy.visit('http://localhost:3000');
  });

  it('should take a screenshot on failure', () => {
    cy.get('button').click();
    cy.get('div.error').should('be.visible');
    cy.screenshot();
  });

  it('should take a screenshot on success', () => {
    cy.get('button').click();
    cy.get('div.success').should('be.visible');
    cy.screenshot();
  });
});

// Run the tests using Docker
describe('My App (Docker)', () => {
  beforeEach(() => {
    cy.runDocker(dockerConfig);
  });

  it('should run the tests', () => {
    cy.visit('http://localhost:3000');
    cy.get('button').click();
    cy.get('div.result').should('be.visible');
  });
});
```
