* `cypress-docker` to run the tests in a Docker container
* `cypress-screenshot` to capture screenshots

The `addCommand` function is used to define a custom command called `screenshot` that saves the current page to a file in the `cypress/screenshots` directory.

The first set of tests uses the `screenshot` command to capture a screenshot when a failure or success condition is met.

The second set of tests runs the tests in a Docker container using the `runDocker` command from `cypress-docker`. This allows you to test your application in a containerized environment.

To run the tests, you'll need to create a `Dockerfile` in the root of your project with the following contents:
