Here is a Python program to find the nth Fibonacci number using dynamic programming:

```
def fibonacci(n):
    if n <= 0:
        return "Input should be a positive integer."
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        fib_values = [0, 1]
        while len(fib_values) < n:
            fib_values.append(fib_values[-1] + fib_values[-2])
        return fib_values[-1]

n = int(input("Enter the position of the Fibonacci number you want to find: "))
print(f"The {n}th Fibonacci number is: {fibonacci(n)}")
```

In this program, we first check if the input `n` is less than or equal to 0, in which case we return an error message. If `n` is 1 or 2, we return 0 and 1 respectively, as these are the first two Fibonacci numbers. 

For `n` greater than 2, we create a list `fib_values` and initialize it with the first two Fibonacci numbers, 0 and 1. We then enter a loop that continues until the length of `fib_values` is equal to `n`. In each iteration of the loop, we append the sum of the last two elements of `fib_values` to `fib_values`. This is because each Fibonacci number is the sum of the two preceding ones. Finally, we return the last element of `fib_values`, which is the `n`th Fibonacci number.

Here is a Python implementation of binary search:

```Python
def binary_search(arr, low, high, x):
    if high >= low:
        mid = (high + low) // 2
        if arr[mid] == x:
            return mid
        elif arr[mid] > x:
            return binary_search(arr, low, mid - 1, x)
        else:
            return binary_search(arr, mid + 1, high, x)
    else:
        return -1

# Test the function
arr = [2, 3, 4, 10, 40]
x = 10
result = binary_search(arr, 0, len(arr)-1, x)
if result != -1:
    print("Element is present at index", str(result))
else:
    print("Element is not present in array")
```

In this code, we define a function `binary_search` that takes a sorted array `arr`, a low index `low`, a high index `high`, and an element `x` to search for. If `high` is greater than or equal to `low`, we calculate the middle index `mid`. If `arr[mid]` is equal to `x`, we return `mid`. If `arr[mid]` is greater than `x`, we recursively call `binary_search` with `low`, `mid - 1`, and `x`. If `arr[mid]` is less than `x`, we recursively call `binary_search` with `mid + 1`, `high`, and `x`. If `high` is less than `low`, it means `x` is not in the array, so we return -1.

The time complexity of this algorithm is O(log n), where n is the length of the array, because we divide the search space in half at each step. The space complexity is O(1), because we only use a constant amount of space to store the indices and the midpoint.

Here's a Python implementation of a queue data structure using two stacks:

```Python
class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        self.stack1.append(item)

    def dequeue(self):
        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        return self.stack2.pop()

    def is_empty(self):
        return self.stack1 == [] and self.stack2 == []

    def size(self):
        return len(self.stack1) + len(self.stack2)


# Testing the Queue
q = Queue()
print(q.is_empty())  # Output: True
q.enqueue(1)
q.enqueue(2)
q.enqueue(3)
print(q.size())  # Output: 3
print(q.dequeue())  # Output: 1
print(q.size())  # Output: 2
print(q.dequeue())  # Output: 2
print(q.dequeue())  # Output: 3
print(q.is_empty())  # Output: True
```

In this implementation, we use two stacks: `stack1` and `stack2`. The `enqueue` operation is implemented by simply pushing the item onto `stack1`. The `dequeue` operation first checks if `stack2` is empty. If it is, it pops all items from `stack1` and pushes them onto `stack2`. Then, it pops the item from `stack2`. If `stack2` is not empty, it simply pops the item from `stack2`. The `is_empty` method checks if both stacks are empty, and the `size` method returns the sum of the sizes of the two stacks.
